@RepJeffries is about to break the record for speaking under the "magic minute" privilege to protest against this horrendous tax break for billionaires bill.  

Let the vote for this measure be held in broad daylight.  I stand with Leader Jeffries against this one big ugly bill.  

I will vote HELL NO!

Republicans claimed the Inflation Reduction Act would hurt working families. But the truth? It empowered the IRS to go after wealthy tax cheats—over 125,000 high-income investigations in 2024 alone.
Now Trump wants to gut IRS staff so billionaires can keep dodging taxes while everyday Americans lose access to basic help.
@HouseDemocrats held a shadow hearing with former IRS Commissioners to debunk Republicans' ridiculous myths.

This morning on @cspanwj, I called out @HouseGOP’s reckless budget proposal. Their reconciliation bill slashes nearly $1 trillion from Medicaid, puts school lunches on the chopping block, and threatens healthcare for millions, all to fund more tax breaks for the ultra-wealthy.
 
@HouseDemocrats are united in fighting back. We’re standing up for working families and protecting access to healthcare and nutrition for those who need it most.

#ProtectMedicaid #NoTaxCutsForTheWealthy

@realDonaldTrump isn’t just criticizing judges—he’s waging a full-blown assault on the judiciary. Calling them “lunatics,” “crooked,” and “evil” isn’t free speech—it’s a calculated attack on the rule of law.
Congress can’t stay silent. We must protect our judges and defend democracy itself.

View my statement here: https://t.co/sKdzovmEpn

According to Yale's @The_Budget_Lab  Trump’s tariff plans will drive up costs for the average American family between $1,600 and $2,000 per year. The costs of specific goods are expected to rise significantly, computers, phones & TVs rise by over 10%;
The price of cars, foreign & domestic, is expected to increase by over 6%;
Clothing prices may rise by 7.5%; https://t.co/O9l4LH1muU

